<template>
  <div>
    <!-- 二维码 -->
    <img :src="qrCodeUrl" style="width: 60%" />
    <img :src="imgBase64" style="width: 60%" />
    <div @click="downLoadQRCode">下载图片</div>
  </div>
</template>

<script>
import { compressImgBySize } from '@/common/js/compressImg.js' 
export default {
  name: "home",
  data() {
    return {
      qrCodeUrl: "",
      imgBase64: "",
    };
  },
  created() {
    //this.qrCodeUrl = 'data:image/png;base64,' + res.data.encode
    this.qrCodeUrl =
      "data:image/png;base64,";
    compressImgBySize(this.qrCodeUrl, 206).then((baseImg) => {
      this.imgBase64 = baseImg;
    });
  },
  methods: {
    // 下载图片
    downLoadQRCode() {
      const a = document.createElement("a");
      a.href = this.qrCodeUrl;
      a.setAttribute("download", decodeURIComponent("测试"));
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
    },
  },
};
</script>

